"""
Given a string s, consider all duplicated substrings: (contiguous) substrings of s that occur 2 or more times. The occurrences may overlap.

Return any duplicated substring that has the longest possible length. If s does not have a duplicated substring, the answer is "".

Example 1:
Input: s = "banana"
Output: "ana"
Example 2:
Input: s = "abcd"
Output: ""

Constraints:

	2 <= s.length <= 3 * 104
	s consists of lowercase English letters.
"""
import sys
import pytest


class Solution:
    def longestDupSubstring(self, s: str) -> str:
        """
        Time complexity: O(n^3) including string slicing
        Space complexity: O(n^2)
        """
        max_length = 0
        ret = ''
        subs = set()
        for i in range(len(s)):
            for j in range(i+1, len(s)+1):
                if j-i < max_length:
                    continue
                sub = s[i:j]
                if sub in subs:
                    if len(sub) > max_length:
                        max_length = len(sub)
                        ret = sub
                subs.add(sub)
        return ret

    def longestDupSubstring(self, s: str) -> str:
        """
        Time complexity: O(n*logn) excluding string slice
        Space complexity: O(n)
        """
        def find_subs(n):
            subs = set()
            for i in range(len(s)-n+1):
                sub = s[i:i+n]
                if sub in subs:
                    return sub
                subs.add(sub)
            return ''

        i, j = 1, len(s)
        ret = ''
        while i <= j:
            m = i + (j-i)//2
            sub = find_subs(m)
            if sub:
                if len(sub) > len(ret):
                    ret = sub
                i = m+1
            else:
                j = m-1

        return ret

    def longestDupSubstring(self, s: str) -> str:
        """
        Using hash
        Time complexity: O(n*logn)
        Space complexity: O(n)
        """
        p = 27
        nums = [ord(x)-ord('a')+1 for x in s]

        def unhash(hashed):
            ret = ''
            while hashed:
                ret = chr(ord('a') + (hashed%p) - 1) + ret
                hashed //= 27
            return ret


        def find_subs(n):
            cap = p**n
            acc = 0
            for i in range(n):
                acc = p*acc + nums[i]
            visited = set([acc])
            for i in range(n, len(nums)):
                acc = (p*acc + nums[i]) % cap
                if acc in visited:
                    return acc
                visited.add(acc)
            return 0

        i, j = 1, len(s)
        mx = 0
        while i <= j:
            m = i + (j-i)//2
            n = find_subs(m)
            if n:
                if n > mx:
                    mx = n
                i = m+1
            else:
                j = m-1

        return unhash(mx)

    def longestDupSubstring(self, s: str) -> str:
        """
        Without unhashing
        Time complexity: O(n*logn)
        Space complexity: O(n)
        """
        p = 27
        nums = [ord(x)-ord('a')+1 for x in s]

        def find_subs(n):
            cap = p**n
            acc = 0
            for i in range(n):
                acc = p*acc + nums[i]
            visited = set([acc])
            for i in range(n, len(nums)):
                acc = (p*acc + nums[i]) % cap
                if acc in visited:
                    return i
                visited.add(acc)
            return 0

        i, j = 1, len(s)
        length = 0
        max_end_idx = 0
        while i <= j:
            m = i + (j-i)//2
            end_idx = find_subs(m)
            if end_idx:
                if m > length:
                    length = m
                    max_end_idx = end_idx
                i = m+1
            else:
                j = m-1

        return s[max_end_idx-length+1:max_end_idx+1]


@pytest.mark.parametrize('s, expected', [
    ("banana", "ana"),
    ("abcd", ""),
    ("", 'akyj'),
    ("", ''),
])
def test(s, expected):
    assert expected == Solution().longestDupSubstring(s)


if __name__ == '__main__':
    sys.exit(pytest.main(["-s", "-v"] + sys.argv))
